INSERT INTO `email_templates` (`emailtemp_key`, `emailtemp_title`, `emailtemp_subject`, `emailtemp_content`, `emailtemp_modified`) VALUES
('artwork_notification', 'New Artwork Uploaded', 'New Artwork Uploaded', '<div style="width: 1000px; margin: auto; border: 1px solid; padding: 20px;">\r\n<div style="font-family: cursive; text-align: center; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); padding-bottom: 15px;"><img src="http://192.168.2.99/sites/artgallery/public/img/header/logo.png" /></div>\r\n\r\n<div style="width: 800px; margin: auto; padding: 25px 0px;">\r\n<h2 style="font-family: cursive;"><span style="font-family:times new roman,times,serif">Greetings from Art2ArtGallery.com.&nbsp;</span></h2>\r\n\r\n<p><font face="times new roman, times, serif">Please log in to view your child&acute;s artworks. Thank you.&nbsp;</font></p>\r\n\r\n<p style="font-family: cursive;"><a href="{website_link}">Art 2 Art Gallery Log in Page</a></p>\r\n&nbsp;\r\n\r\n<p style="font-family: cursive;">&nbsp;</p>\r\n\r\n<table cellpadding="5" cellspacing="5" style="font-family:cursive; width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; width:30%">Artwork Title</td>\r\n			<td style="width:50%">{art_title}</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; width:30%">Artwork Description</td>\r\n			<td style="width:50%">{art_desc}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<font face="cursive">&nbsp;</font>\r\n\r\n<div style="font-family: cursive;">&nbsp;</div>\r\n\r\n<div style="font-family: cursive;"><span style="font-family:times new roman,times,serif">Art 2 Art Gallery Team</span></div>\r\n</div>\r\n\r\n<div style="font-family: cursive; text-align: center; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(204, 204, 204); padding-top: 15px;">All Rights Reserved <strong>Art 2 Art Gallery</strong> &copy; 2016</div>\r\n</div>\r\n', '2015-02-07 13:04:43'),
('contact_us_admin', 'Contact Us Admin Format', 'Contact Us Mail', '<div style="max-width:640px;font-family:''Arial''; margin:0 auto;">\r\n<table cellpadding="0" cellspacing="0" style="border:solid 1px #dbcfc1; width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<div style=" background:#002142; color:#ffffff;text-align:center;padding:10px 0;margin:0; font-size:24px; font-weight:bold;">ART GALLERY</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#ffffff;padding:10px;">\r\n			<p>Dear Artgallery Admin,<br />\r\n			<br />\r\n			We have received a new message, please find the details below.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#f3f3f3;padding:10px;">\r\n			<p><strong>Contact Form Information</strong></p>\r\n\r\n			<table cellpadding="4" cellspacing="2" style="font-size:13px; width:100%">\r\n				<tbody>\r\n					<tr>\r\n						<td style="width:30%"><strong>Full Name</strong></td>\r\n						<td>{guest_name}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="width:30%"><strong>Email Address</strong></td>\r\n						<td style="vertical-align:top">{guest_email}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="width:30%"><strong>Phone No</strong></td>\r\n						<td style="vertical-align:top">{guest_phone}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="width:30%"><strong>Email Address</strong></td>\r\n						<td style="vertical-align:top">{guest_message}</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#002142; padding:4px;font-size:12px;text-align:center;color:white">\r\n			<p>Copyright &copy; 2016 Art 2 Art Gallery. All rights reserved. Terms of Use Privacy Policy</p>\r\n\r\n			<p><strong><a href="#" style="color:inherit;color:white">Visit Website</a></strong></p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '2014-06-24 09:55:47'),
('contact_us_user', 'Contact Us User Mail Format', 'Contact Us Mail ', '<div style="max-width:640px;font-family:''Arial''; margin:0 auto;">\r\n<table cellpadding="0" cellspacing="0" style="border:solid 1px #dbcfc1; width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<div style=" background:#002142; color:#ffffff;text-align:center;padding:10px 0;margin:0; font-size:24px; font-weight:bold;">BELLINGTON</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#FFFFFF;padding:10px;">\r\n			<p><strong>Dear {guest_name}</strong></p>\r\n\r\n			<p>Welcome to BELLINGTON</p>\r\n\r\n			<p>If it is not real text, they will focus on the design. This string is randomly generated. It looks even better with you using this text. It looks even better with you using this text. A designer can use default text to simulate what text would look like. I hope you enjoyed the fake text. That is preciously how this string was constructed. After Hours Programming created this application.</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#f3f3f3;padding:10px;">\r\n			<p style="text-align:center">About Us</p>\r\n\r\n			<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer congue justo ac quam dapibus feugiat. Aenean sapien ligula, hendrerit quis nibh id, lacinia placerat nisi. Duis ac hendrerit lacus.</p>\r\n\r\n			<p>Integer at diam varius, vehicula quam nec, imperdiet ipsum. Aenean gravida luctus sapien, vitae varius nibh aliquet quis. Ut consectetur tristique sem, nec mattis orci placerat vel. Vivamus sagittis tortor sed tellus scelerisque sagittis. Curabitur eget lacinia nibh, eu scelerisque erat. Nam a tempor leo. Integer ullamcorper vel nulla sit amet suscipit.</p>\r\n\r\n			<p>Suspendisse orci mi, tempus at justo aliquet, egestas adipiscing justo. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Cras sit amet leo iaculis, sagittis dolor at, gravida orci. Morbi ac volutpat purus