('invite_parent', 'Invitation to Parent', 'Invitation to Parent', '<div style="width:1000px;margin:auto;border:1px solid;padding:20px;font-family:cursive">\r\n<div style="text-align:center;border-bottom:1px solid #CCC;padding-bottom:15px"><img src="{site_logo}" /></div>\r\n\r\n<div style="width:800px;margin:auto;padding:25px 0">\r\n<h2><span style="font-family:times new roman,times,serif">Dear Parent,</span></h2>\r\n\r\n<p><span style="font-family:times new roman,times,serif">We are pleased to introduce you to the art2artgallery.com. It is a website that will allow you to keep all your child&acute;s creative school artworks in an online portfolio. As a result, you have access to view all their works at your convenience and have the option of sharing their artworks with your loved ones.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif">For more information on the website, please visit art2artgallery.com.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif">For Login details and to visit the artworks, kindly clikc on the link below and enter the following details to log in to the system.</span></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif"><a href="{website_link}">Art 2 Art Gallery Login Page</a></span></p>\r\n&nbsp;\r\n\r\n<table cellpadding="5" cellspacing="5" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; width:30%"><span style="font-family:times new roman,times,serif">Email</span></td>\r\n			<td style="width:50%"><span style="font-family:times new roman,times,serif">{user_email}</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; width:30%"><span style="font-family:times new roman,times,serif">Password</span></td>\r\n			<td style="width:50%"><span style="font-family:times new roman,times,serif">{upassword}</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<div><span style="font-family:times new roman,times,serif">Thank you,</span></div>\r\n\r\n<div><span style="font-family:times new roman,times,serif">Art 2 Art Gallery Staff</span></div>\r\n</div>\r\n\r\n<div style="text-align:center;border-top:1px solid #CCC;padding-top:15px;"><span style="font-family:times new roman,times,serif">All Rights Reserved <strong>Art 2 Art Gallery</strong> &copy; 2015</span></div>\r\n</div>\r\n', '2015-02-09 13:04:43'),
('invite_teacher', 'Invitation to Teacher', 'Invitation from School to Teacher', '<div style="width: 1000px; margin: auto; border: 1px solid; padding: 20px;">\r\n<div style="font-family: cursive; text-align: center; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); padding-bottom: 15px;"><span style="font-family:times new roman,times,serif"><img src="{site_logo}" /></span></div>\r\n\r\n<div style="width: 800px; margin: auto; padding: 25px 0px;">\r\n<h2><span style="font-family:times new roman,times,serif">Dear Teacher,</span></h2>\r\n\r\n<h2><span style="font-family:times new roman,times,serif"><span style="font-size:13px; line-height:1.6">Welcome to art2argallery.com., a website where creativity is captured and shared. As teachers, we hope to create an online gallery where a student&acute;s artworks can be shared with their parents in a private gallery and with the world in a public gallery in real time. &nbsp;We would like to invite you to join our art2artgallery team. Kindly &nbsp;setup your account by clicking on the link to create your profile. &nbsp;</span></span></h2>\r\n\r\n<p style="font-family: cursive;"><span style="font-family:times new roman,times,serif">Please Click the link below to create your account.</span></p>\r\n\r\n<p style="font-family: cursive;"><span style="font-family:times new roman,times,serif"><a href="{registerkey}">Art 2 Art Gallery</a></span></p>\r\n&nbsp;\r\n\r\n<div style="font-family: cursive;"><span style="font-family:times new roman,times,serif">Thank you,&nbsp;</span></div>\r\n\r\n<div style="font-family: cursive;"><span style="font-family:times new roman,times,serif">Art 2 Art Gallery Team</span></div>\r\n</div>\r\n\r\n<div style="font-family: cursive; text-align: center; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(204, 204, 204); padding-top: 15px;"><span style="font-family:times new roman,times,serif">All Rights Reserved <strong>Art 2 Art Gallery</strong> &copy; 2016</span></div>\r\n</div>\r\n', '2014-06-24 13:04:43'),
('parent_register', 'Student Registration', 'Student registration ', '<div style="width:1000px;margin:auto;border:1px solid;padding:20px;font-family:cursive">\r\n<div style="text-align:center;border-bottom:1px solid #CCC;padding-bottom:15px"><img src="{site_logo}" /></div>\r\n\r\n<div style="width:800px;margin:auto;padding:25px 0">\r\n<h2>Hi !</h2>\r\n\r\n<p>{school_name} has&nbsp;added your children {user_name} as a student in their institute, please setup your account using below given link to check out &nbsp;artworks and manage his/her profile.&nbsp;</p>\r\n\r\n<p>Please Click the link below to create your account.</p>\r\n\r\n<p><a href="{registerkey}">Art 2 Art Gallery Login Page </a></p>\r\n&nbsp;\r\n\r\n<div>Thanks</div>\r\n\r\n<div>Art 2 Art Gallery Staff</div>\r\n</div>\r\n\r\n<div style="text-align:center;border-top:1px solid #CCC;padding-top:15px;">All Rights Reserved <strong>Art 2 Art Gallery</strong> &copy; 2016</div>\r\n</div>\r\n', '2014-06-24 13:04:43'),
('registration_email', 'Registration Email', 'Registration Successful.', '<div style="max-width:640px;font-family:''Arial''; margin:0 auto;">\r\n<table cellpadding="0" cellspacing="0" style="border:solid 1px #dbcfc1; width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<div style=" background:#002142; color:#ffffff;text-align:center;padding:10px 0;margin:0; font-size:24px; font-weight:bold;">ARTGALLERY</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#ffffff;padding:10px;">\r\n			<p><strong>Dear {user_email}</strong></p>\r\n\r\n			<p>We have receieved your request for registration as a school with Art2ArtGallery.com. Please click on the link below to verify that we have same email address so we can complete your verification process.</p>\r\n\r\n			<p>Thank you.</p>\r\n\r\n			<p style="text-align:center"><a href="{verification_link}" style="background:#bfb860;border-radius:6px;padding:8px 12px;font-size:14px; font-weight:bold; text-decoration:none;color:white">Verify Email Address</a></p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#f3f3f3;padding:10px;">\r\n			<p style="text-align:center">&nbsp;</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style="background:#002142; padding:4px;font-size:12px;text-align:center;color:white">\r\n			<p>Copyright &copy; 2016 Art2Artgallery. All rights reserved.</p>\r\n\r\n			<p><strong><a href="{website_link}" style="color:inherit;color:#ffffff">Visit Website</a></strong></p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '2014-06-24 12:45:35'),
('request_parent_view', 'New Request from Parent', 'New Request from Parent', '<div style="width:1000px;margin:auto;border:1px solid;padding:20px;font-family:cursive">\r\n<div style="text-align:center;border-bottom:1px solid #CCC;padding-bottom:15px"><img src="{site_logo}" /></div>\r\n\r\n<div style="width:800px;margin:auto;padding:25px 0">\r\n<h2>Greetings from Art2ArtGallery</h2>\r\n\r\n<p>Mr.<strong>{sender_name}</strong> has requested access to see your child&#39;s artwork.</p>\r\n\r\n<p>See his message below</p>\r\n\r\n<p>{request_message}</p>\r\n\r\n<p>To view the request Click the link below and log in to answer the request</p>\r\n\r\n<p><a href="{website_link}">Art 2 Art Gallery Log in Page</a></p>\r\n&nbsp;\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Thanks</div>\r\n\r\n<div>Art 2 Art Gallery Staff</div>\r\n</div>\r\n\r\n<div style="text-align:center;border-top:1px solid #CCC;padding-top:15px;">All Rights Reserved <strong>Art 2 Art Gallery</strong> &copy; 2015</div>\r\n</div>\r\n', '2015-02-07 13:04:43'),
