INSERT INTO `module_faq` (`faq_ques_id`, `faq_ques_category_id`, `faq_ques_title`, `faq_ques_answer`, `faq_ques_status`, `faq_created`) VALUES
(1, 6, 'What is art2artgallery.com?', '<p>Art2artgallery.com is a free tool that allows parents to SAVE and SHARE their child&acute;s creative&nbsp;school works online in a private and public art gallery.</p>', '1', '2016-02-02 10:49:57'),
(2, 6, 'Why do I need art2artgallery.com?', '<p>STORE all kinds of school work online<br />\r\nRETRIEVE any particular school work at any time and anywhere<br />\r\nSHARE your child&acute;s projects and creativity with anyone<br />\r\nORGANIZE your child&acute;s works in an e-portfolio according to tags and labels set by teachers<br />\r\nTREASURE your child&acute;s thought process</p>', '1', '2016-02-02 06:35:40'),
(3, 6, 'What is a private art gallery?', '<p>A private art gallery is a space allotted to your child that stores all of his/her creative school works.<br />\r\nThe parent/guardian have access to this private gallery.</p>', '1', '2016-02-02 06:42:25'),
(4, 6, 'How do you define creative school work ?', '<p>Creative school work is an expression of a child&acute;s thinking process. It can range&nbsp;anywhere from a simple line doodle to an architectural structure or even a solution to a math&nbsp;problem. Creative works showcase the varied approaches students use in their thought processes.</p>', '1', '2016-02-02 10:52:01'),
(5, 6, 'How does art2artgallery.com work?', '<p>Teachers capture creative works of their students with their photographic devices. They then crop,<br />\r\nlabel, title, date, and comment. Creative works are sent to the student&acute;s parents which are saved by<br />\r\ndefault and which can be shared through social media.</p>', '1', '2016-02-02 06:43:01'),
(6, 7, 'What are the privacy issues in the public gallery?', '<p>Any image captured by a teacher either in the private or the public gallery consists of school work.<br />\r\nAny image of the student cannot be displayed. In a public gallery, the information displayed on the<br />\r\ncreative works are the title of the piece, the name of the school, the city, and the age of the student.<br />\r\nIn the public gallery the name of the student is withheld as is his/her picture.</p>', '1', '2016-02-02 06:43:32'),
(7, 8, 'Can parents/guardians decide how often they wish to be notified?', '<p>Parents/guardians can decide on a default option upon registration how often they would like to be<br />\r\nnotified and at what optimum time they can receive the uploaded school works.</p>', '1', '2016-02-02 06:45:12'),
(8, 8, 'Can I retrieve my child&acute;s school work at any given time?', '<p>Yes. As a parent/guardian, you can access to VIEW ONLY your child&acute;s artwork in the private<br />\r\ngallery at any time and are able to share it on social media.</p>', '1', '2016-02-02 06:45:28'),
(9, 8, 'Can I like my child&acute;s page on the public gallery?', '<p>Since there will be a display of a diverse group of children&acute;s artworks in the public gallery, a<br />\r\ncommunity of unhealthy competition and comparison may be generated with the amounts of likes<br />\r\nan artworks may inspire. As of now, the public gallery is for viewing, searching and researching<br />\r\npurposes only.</p>', '1', '2016-02-02 06:45:45'),
(10, 8, 'Can the parent/guardian decide what pieces of their child&acute;s creative works they would like to be uploaded to the private and the public gallery?', '<p>The parents/guardians are only allowed to view and share their child&acute;s creative pieces through<br />\r\nsocial media. The creative work pieces will be automatically saved in their private gallery.</p>', '1', '2016-02-02 06:46:01'),
(11, 8, 'Can a parent share more information other the images in the art gallery? Ex: comments by teacher, subject, school information, date the image was produced.', '<p>By default, only the image can be shared via social media. Any other description by the teacher or<br />\r\nkey labels of the artwork remains private and only for viewing purposes in the private gallery.</p>', '1', '2016-02-02 06:46:20'),
(12, 8, 'As a parent, how can I access another student&acute;s private gallery?', '<p>There is an option to request permission to view another student&acute;s art gallery.</p>', '1', '2016-02-02 06:46:53'),
(13, 8, 'Can I upload artworks that my child has created from many year ago?', '<p>Yes. These artworks can be uploaded personally by the parent/guardian and is not the responsibility<br />\r\nof any teacher or any school. These artworks will be held in a different section of the private gallery<br />\r\nand cannot be uploaded to the public gallery. There is a subscription fee.</p>', '1', '2016-02-02 06:47:10'),
(14, 8, 'What is the monthly fee for parents/guardians to upload individual images of their child&acute;s artworks?', '<p>To be disclosed soon.</p>', '1', '2016-02-02 06:47:39'),
(15, 9, 'How often does the teacher submit the creative artworks to the parents?', '<p>The teacher in unison with the school will submit artworks based on the school&acute;s criteria and<br />\r\nstandards. Schools can submit works on a weekly, bimonthly or even on a daily basis depending on<br />\r\ntheir unique academic approach. In addition, parents by default can ask how often during a month<br />\r\nthey would like to receive the artworks.</p>', '1', '2016-02-02 06:47:57'),
(16, 9, 'As a teacher, how can I access another student&acute;s private gallery who is not in my class?', '<p>There is an option to request permission to view another student&acute;s art gallery. The request, once sent<br />\r\nneeds to be approved, and once approved, a one time password is sent to your phone enabling you<br />\r\nto view the specific artworks set by the parent/guardian whose chid&acute;s work was requested for.</p>', '1', '2016-02-02 06:48:16'),
(17, 9, 'Who decides on what creative works to be uploaded?', '<p>The teacher is responsible for the selection process. She/He decides which artworks are sent to the<br />\r\nparent in the private gallery and which artworks from the private gallery are submitted to the public<br />\r\ngallery.</p>', '1', '2016-02-02 06:48:31'),
(18, 10, 'What is the art2artgallery public gallery?', '<p>It is a creative space that gives access to students to display their creative school works for anyone<br />\r\nto view.</p>', '1', '2016-02-02 06:49:58'),
(19, 10, 'Which student&acute;s creative artworks are represented in the public art gallery?', '<p>By default, each child is equally represented in the public gallery. If a particular child has three<br />\r\nartworks that the teacher would like to submit within a week, the teacher is also responsible to<br />\r\nsubmit the same number of artworks for every child.</p>', '1', '2016-02-02 06:50:21'),
(20, 10, 'How can I find a particular art piece in the public gallery?', '<p>The search tool allows the user to find artworks based on several key words that have been<br />\r\npreviously documented. The search tool allows you to search for artworks based on the following:<br />\r\ncity, country, school, title, grade, age, sex,curriculum, title, subject.</p>', '1', '2016-02-02 06:50:57'),
(21, 11, 'What happens if I lose all the images of my child&acute;s school work?', '<p>Art2artgallery.com assures you everything you upload is secure and accessible.</p>', '1', '2016-02-02 06:51:25'),
(22, 11, 'Can I back up my child&acute;s school work?', '<p>Art2artgallery.com assures you the the images are backed up in our server. We also recommend an<br />\r\nauto-sync with Drop Box.</p>', '1', '2016-02-02 06:51:45'),
(23, 11, 'How do homeschooled children upload their creative works in the public gallery?', '<p>Parents/guardians/teachers who are responsible for the homeschooling of their children will be<br />\r\ndirected to the paid service. Please contact art2artgallery for further enquiries.</p>', '1', '2016-02-02 06:52:12'),
(25, 11, 'What if I don&amp;amp;acute;t want my child&amp;amp;acute;s work to be submitted into a the public gallery?', 'The public gallery is a representation of the creative thought process of all the students. If a parent \r\ndoes not want their child''s work displayed in the public gallery, an accordance between the school \r\nand the parent needs to be agreed upon. By default, the teacher elects certain images that \r\nautomatically are viewed in the public gallery.', '1', '2016-02-02 10:53:34');
