INSERT INTO `pages` (`page_id`, `page_title`, `page_content`, `page_updated`) VALUES
(1, 'About Us', '<div class="about-innerwrapper2 mtop20">\r\n	<div class="container">\r\n    	<br />\r\n		<div class="row">\r\n			<div class="col-md-7 col-sm-6 text-left">\r\n				<h3 class="sppb-addon-title text-left" style="margin-bottom:30px;padding-bottom:5px">Welcome to Art 2 Art Gallery</h3>\r\n				<div class="sppb-addon-content">\r\n					<p>\r\n                    	As an aspiring teacher and a conscious parent, I understand how important doodles,\r\n                        drawings, and projects can be for children. I love receiving my children''s creative\r\n                        artworks online from their schools and enjoy sharing it immediately with my family and\r\n                        friends. Not only am I up to date with their learning process but I have greater insight\r\n                        into how my children are performing in school on a regular basis. And to top it all, I no\r\n                        longer have to depend on cardboard boxes stuffed with priceless drawings and\r\n                        invaluable art projects that I have collected over the years.\r\n                    </p>\r\n				</div>\r\n			</div>\r\n            <div class="col-md-5 col-sm-6">\r\n            	<img class="img-responsive center-block" src="http://art2artgallery.com/public/img/team-full.jpg" alt="team-full" />\r\n            </div>\r\n		</div>\r\n        \r\n        <br />\r\n        <hr />\r\n        \r\n        \r\n        <div class="row">\r\n        	<div class="col-md-6">\r\n            	<img class="img-responsive center-block" src="http://art2artgallery.com/public/img/header/main-logo.png" alt="copyright-logo" title="site copyright logo. All rights reserved Nollyact &copy;" />\r\n            </div>\r\n            <div class="col-md-6 text-left">\r\n				<h3 class="sppb-addon-title text-left" style="margin-bottom:30px;padding-bottom:5px">Who we are</h3>\r\n                <div class="sppb-addon-content">\r\n                	<p>\r\n                    	Art2Art Gallery is best described as an all inclusive school gallery with a heartbeat that\r\n                    	encourages children to discover their voice, communicate their story, and inspire other\r\n                    	childrenÂ´s hearts and minds.\r\n					</p>\r\n				</div>\r\n            </div>\r\n        </div>\r\n        \r\n        <br />\r\n        <hr />\r\n        \r\n        <div class="row">\r\n        	<div class="col-md-12 text-center">\r\n            	<p><h3 class="sppb-title-heading" style="margin-bottom:30px;">What we do</h3></p>\r\n            </div>\r\n            <div class="col-md-12 text-center">\r\n            	<div class="row">\r\n                	<div class="col-md-6 text-center font18">\r\n                    	<p style="font-size:48px">\r\n                    		<i class="fa fa-user-plus"></i>\r\n                    	</p>\r\n                    	<div><strong>Teachers</strong></div>\r\n                    	<div class="font16">\r\n                    		As teachers we capture their thought processes through creative projects, words, pictures\r\n                            and artworks that are stemmed from math, english, science, music and all other subjects\r\n                            in hope that they continue to love learning as much as we do.\r\n                    	</div>\r\n                    </div>\r\n                    <div class="col-md-6 text-center font18">\r\n                    	<p style="font-size:48px">\r\n                    		<i class="fa fa-user-secret"></i>\r\n                    	</p>\r\n                    	<div><strong>Parents</strong></div>\r\n                    	<div class="font16">\r\n                    		As parents, we save these precious creative solutions and artworks that our children have\r\n                        	so carefully created and share their artworks with our loved ones knowing we can\r\n                        	treasure their creativity and retrieve it any moment. Finally!!\r\n                    	</div>\r\n                    </div>\r\n                </div>\r\n                <br />\r\n                <hr />\r\n                <div class="row">\r\n                	<div class="col-md-12 text-left">\r\n                		<p>\r\n                            With art2artgallery.com, I can access my childrenÂ´s gallery and retrieve their school\r\n                            creative artworks anytime and anywhere. I have successfully found doodles and\r\n                            drawings from when they were in Pre K that melts my heart and as they get older, I\r\n                            receive more project related artworks. Last week, my sonÂ´s science teacher sent me an\r\n                            image of a 3D solar powered pizza box that my son designed. Within minutes I shared it\r\n                            with everyone else in my family knowing well that the art gallery will also inspire other\r\n                            children to speak about their knowledge on solar energy.\r\n                        </p>\r\n                        <p>\r\n                        	What started out as a solution to solving a storage problem has ended up becoming a\r\n                            platform for children to find their voices and express themselves. I hope every child\r\n                            through their school will be able to showcase their work and inspire themselves and\r\n                            others in this creative and heartfelt journey.\r\n                        </p>\r\n                        \r\n                	</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n	</div>\r\n</div>', '2016-03-17 11:05:31');
